import { Link, Route } from "wouter";
import Home from "./pages/Home";

export default function Main() {

    return (
        <section className="main">
            <h1>GIFWORLD</h1>
            <p>Eexplore nonasodnasdosandosndodsj</p>
            <Link to='/'><button>GO</button>
            <Route component={Home} path='/home' /></Link>
        </section>
    )
}
